BD%D1%82%D0%B8%D0%B9_IV\" title=\"\u0418\u043d\u043d\u043e\u043a\u0435\u043d\u0442\u0438\u0439 IV\">\u0418\u043d\u043d\u043e\u043a\u0435\u043d\u0442\u0438\u0439 IV<\/a> \u043e\u0433\u043b\u0430\u0441\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%BB%D0%BB%D0%B0\" title=\"\u0411\u0443\u043b\u043b\u0430\">\u0431\u0443\u043b\u043b\u0443<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Ad_extirpanda\" title=\"Ad extirpanda\">Ad extirpanda<\/a>\u00bb, \u0440\u0430\u0437\u0440\u0435\u0448\u0430\u044e\u0449\u0443\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D1%8F%D1%82%D0%B0%D1%8F_%D0%B8%D0%BD%D0%BA%D0%B2%D0%B8%D0%B7%D0%B8%D1%86%D0%B8%D1%8F\" title=\"\u0421\u0432\u044f\u0442\u0430\u044f \u0438\u043d\u043a\u0432\u0438\u0437\u0438\u0446\u0438\u044f\">\u0438\u043d\u043a\u0432\u0438\u0437\u0438\u0446\u0438\u0438<\/a> \u043f\u044b\u0442\u0430\u0442\u044c \u043f\u043e\u0434\u043e\u0437\u0440\u0435\u0432\u0430\u0435\u043c\u044b\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D1%80%D0%B5%D1%81%D1%8C\" title=\"\u0415\u0440\u0435\u0441\u044c\">\u0435\u0440\u0435\u0441\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1484_%D0%B3%D0%BE%D0%B4\" title=\"1484 \u0433\u043e\u0434\">1484<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%9A%D1%80%D0%B5%D0%BC%D0%BB%D1%8C\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u041a\u0440\u0435\u043c\u043b\u044c\">\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u043c \u041a\u0440\u0435\u043c\u043b\u0435<\/a> \u0437\u0430\u043b\u043e\u0436\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BB%D0%B0%D0%B3%D0%BE%D0%B2%D0%B5%D1%89%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80\" class=\"mw-disambig\" title=\"\u0411\u043b\u0430\u0433\u043e\u0432\u0435\u0449\u0435\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440\">\u0411\u043b\u0430\u0433\u043e\u0432\u0435\u0449\u0435\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1525_%D0%B3%D0%BE%D0%B4\" title=\"1525 \u0433\u043e\u0434\">1525<\/a>&#160;\u2014 \u0432\u043e\u0441\u0441\u0442\u0430\u0432\u0448\u0438\u0435 \u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0435, \u0432\u0435\u0434\u043e\u043c\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8E%D0%BD%D1%86%D0%B5%D1%80,_%D0%A2%D0%BE%D0%BC%D0%B0%D1%81\" title=\"\u041c\u044e\u043d\u0446\u0435\u0440, \u0422\u043e\u043c\u0430\u0441\">\u0422\u043e\u043c\u0430\u0441\u043e\u043c \u041c\u044e\u043d\u0446\u0435\u0440\u043e\u043c<\/a> \u0440\u0430\u0437\u0431\u0438\u0442\u044b \u0432 <a href=\"https:\/\/es.wikipedia.org\/wiki\/Batalla_de_Frankenhausen\" class=\"extiw\" title=\"es:Batalla de Frankenhausen\">\u0431\u0438\u0442\u0432\u0435 \u043f\u0440\u0438 \u0424\u0440\u0430\u043d\u043a\u0435\u043d\u0445\u0430\u0443\u0437\u0435\u043d\u0435<\/a>, \u0447\u0442\u043e \u043f\u043e\u043b\u043e\u0436\u0438\u043b\u043e \u043a\u043e\u043d\u0435\u0446 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B5%D1%81%D1%82%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u041a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438\">\u041a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u0435<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D1%8F%D1%89%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0421\u0432\u044f\u0449\u0435\u043d\u043d\u0430\u044f \u0420\u0438\u043c\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0439 \u0420\u0438\u043c\u0441\u043a\u043e\u0439 \u0418\u043c\u043f\u0435\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1536_%D0%B3%D0%BE%D0%B4\" title=\"1536 \u0433\u043e\u0434\">1536<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B5%D0%B9%D0%BD,_%D0%90%D0%BD%D0%BD%D0%B0\" title=\"\u0411\u043e\u043b\u0435\u0439\u043d, \u0410\u043d\u043d\u0430\">\u0410\u043d\u043d\u0430 \u0411\u043e\u043b\u0435\u0439\u043d<\/a> \u0438 \u0435\u0451 \u0431\u0440\u0430\u0442 \u043b\u043e\u0440\u0434 \u0414\u0436\u043e\u0440\u0434\u0436 \u0420\u043e\u0447\u0444\u043e\u0440\u0434 \u043e\u0431\u0432\u0438\u043d\u0435\u043d\u044b \u0441\u0443\u043f\u0440\u0443\u0433\u043e\u043c \u0410\u043d\u043d\u044b, \u043a\u043e\u0440\u043e\u043b\u0451\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85_VIII\" title=\"\u0413\u0435\u043d\u0440\u0438\u0445 VIII\">\u0413\u0435\u043d\u0440\u0438\u0445\u043e\u043c VIII<\/a>, \u0432 \u043b\u044e\u0431\u043e\u0432\u043d\u043e\u0439 \u0441\u0432\u044f\u0437\u0438. \u041e\u0431\u0430 \u0431\u0443\u0434\u0443\u0442 \u043a\u0430\u0437\u043d\u0435\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1567_%D0%B3%D0%BE%D0%B4\" title=\"1567 \u0433\u043e\u0434\">1567<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B8%D1%8F_%D0%A1%D1%82%D1%8E%D0%B0%D1%80%D1%82\" title=\"\u041c\u0430\u0440\u0438\u044f \u0421\u0442\u044e\u0430\u0440\u0442\">\u041c\u0430\u0440\u0438\u044f \u0421\u0442\u044e\u0430\u0440\u0442<\/a>, \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0430 \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0438, \u0432\u044b\u0445\u043e\u0434\u0438\u0442 \u0437\u0430\u043c\u0443\u0436 \u0437\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B5%D0%BF%D0%B1%D0%B5%D1%80%D0%BD,_%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81,_4-%D0%B9_%D0%B3%D1%80%D0%B0%D1%84_%D0%91%D0%BE%D1%82%D0%B2%D0%B5%D0%BB%D0%BB\" title=\"\u0425\u0435\u043f\u0431\u0435\u0440\u043d, \u0414\u0436\u0435\u0439\u043c\u0441, 4-\u0439 \u0433\u0440\u0430\u0444 \u0411\u043e\u0442\u0432\u0435\u043b\u043b\">\u0414\u0436\u0435\u0439\u043c\u0441\u0430 \u0425\u0435\u043f\u0431\u0435\u0440\u043d\u0430, 4-\u0433\u043e \u0433\u0440\u0430\u0444\u0430 \u0411\u043e\u0442\u0432\u0435\u043b\u043b\u0430<\/a>. \u0421\u0432\u0430\u0434\u044c\u0431\u0430 \u043f\u043e\u0441\u043b\u0443\u0436\u0438\u043b\u0430 \u043f\u043e\u0432\u043e\u0434\u043e\u043c \u043a \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u044e \u0448\u043e\u0442\u043b\u0430\u043d\u0434\u0441\u043a\u043e\u0439 \u0437\u043d\u0430\u0442\u0438 \u0438 \u0441\u0442\u0430\u043b\u0430 \u0434\u043b\u044f \u043d\u0438\u0445 \u043e\u0431\u043e\u0438\u0445 \u043d\u0430\u0447\u0430\u043b\u043e\u043c \u043a\u043e\u043d\u0446\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1618_%D0%B3%D0%BE%D0%B4\" title=\"1618 \u0433\u043e\u0434\">1618<\/a>&#160;\u2014 \u041d\u0435\u043c\u0435\u0446\u043a\u0438\u0439 \u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B5%D0%BF%D0%BB%D0%B5%D1%80,_%D0%98%D0%BE%D0%B3%D0%B0%D0%BD%D0%BD\" title=\"\u041a\u0435\u043f\u043b\u0435\u0440, \u0418\u043e\u0433\u0430\u043d\u043d\">\u0418\u043e\u0433\u0430\u043d\u043d \u041a\u0435\u043f\u043b\u0435\u0440<\/a> \u043e\u0442\u043a\u0440\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BA%D0%BE%D0%BD%D1%8B_%D0%9A%D0%B5%D0%BF%D0%BB%D0%B5%D1%80%D0%B0\" title=\"\u0417\u0430\u043a\u043e\u043d\u044b \u041a\u0435\u043f\u043b\u0435\u0440\u0430\">\u0437\u0430\u043a\u043e\u043d\u044b \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u044f \u043f\u043b\u0430\u043d\u0435\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1648_%D0%B3%D0%BE%D0%B4\" title=\"1648 \u0433\u043e\u0434\">1648<\/a>&#160;\u2014 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%81%D1%82%D1%84%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80\" title=\"\u0412\u0435\u0441\u0442\u0444\u0430\u043b\u044c\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\">\u0412\u0435\u0441\u0442\u0444\u0430\u043b\u044c\u0441\u043a\u0438\u0439 \u043c\u0438\u0440<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B8%D0%B4%D1%86%D0%B0%D1%82%D0%B8%D0%BB%D0%B5%D1%82%D0%BD%D1%8F%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0422\u0440\u0438\u0434\u0446\u0430\u0442\u0438\u043b\u0435\u0442\u043d\u044f\u044f \u0432\u043e\u0439\u043d\u0430\">\u0422\u0440\u0438\u0434\u0446\u0430\u0442\u0438\u043b\u0435\u0442\u043d\u044e\u044e \u0432\u043e\u0439\u043d\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1673_%D0%B3%D0%BE%D0%B4\" title=\"1673 \u0433\u043e\u0434\">1673<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%91%D0%B0%D1%80%D0%BB%D1%8C,_%D0%9A%D0%BE%D1%80%D0%BD%D0%B5%D0%BB%D0%B8%D1%83%D1%81&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0411\u0430\u0440\u043b\u044c, \u041a\u043e\u0440\u043d\u0435\u043b\u0438\u0443\u0441 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041a\u043e\u0440\u043d\u0435\u043b\u0438\u0443\u0441<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%91%D0%B0%D1%80%D0%BB%D1%8C,_%D0%A0%D0%BE%D0%B7%D0%B0&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0411\u0430\u0440\u043b\u044c, \u0420\u043e\u0437\u0430 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0420\u043e\u0437\u0430 \u0411\u0430\u0440\u043b\u044c<\/a> \u043f\u043e\u043b\u0443\u0447\u0430\u044e\u0442 \u043f\u0440\u0435\u043c\u0438\u044e \u0437\u0430 \u0432\u044b\u0432\u0435\u0434\u0435\u043d\u043d\u044b\u0439 \u0438\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D1%91%D1%80%D0%BD%D1%8B%D0%B9_%D1%82%D1%8E%D0%BB%D1%8C%D0%BF%D0%B0%D0%BD_(%D1%80%D0%B0%D1%81%D1%82%D0%B5%D0%BD%D0%B8%D0%B5)\" title=\"\u0427\u0451\u0440\u043d\u044b\u0439 \u0442\u044e\u043b\u044c\u043f\u0430\u043d (\u0440\u0430\u0441\u0442\u0435\u043d\u0438\u0435)\">\u0447\u0451\u0440\u043d\u044b\u0439 \u0442\u044e\u043b\u044c\u043f\u0430\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1682_%D0%B3%D0%BE%D0%B4\" title=\"1682 \u0433\u043e\u0434\">1682<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D1%80%D0%B5%D0%BB%D0%B5%D1%86%D0%BA%D0%B8%D0%B9_%D0%B1%D1%83%D0%BD%D1%82_(1682)\" title=\"\u0421\u0442\u0440\u0435\u043b\u0435\u0446\u043a\u0438\u0439 \u0431\u0443\u043d\u0442 (1682)\">\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0441\u0442\u0440\u0435\u043b\u044c\u0446\u043e\u0432 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435<\/a>. \u0423\u0431\u0438\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BB%D0%B3%D0%BE%D1%80%D1%83%D0%BA%D0%BE%D0%B2,_%D0%AE%D1%80%D0%B8%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B5%D0%B2%D0%B8%D1%87_(%D0%B1%D0%BE%D1%8F%D1%80%D0%B8%D0%BD)\" title=\"\u0414\u043e\u043b\u0433\u043e\u0440\u0443\u043a\u043e\u0432, \u042e\u0440\u0438\u0439 \u0410\u043b\u0435\u043a\u0441\u0435\u0435\u0432\u0438\u0447 (\u0431\u043e\u044f\u0440\u0438\u043d)\">\u042e.&#160;\u0410.&#160;\u0414\u043e\u043b\u0433\u043e\u0440\u0443\u043a\u043e\u0432<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%BC%D0%BE%D0%B4%D0%B0%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B9_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0420\u043e\u043c\u043e\u0434\u0430\u043d\u043e\u0432\u0441\u043a\u0438\u0439, \u0413\u0440\u0438\u0433\u043e\u0440\u0438\u0439 \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\">\u0413.&#160;\u0413.&#160;\u0420\u043e\u043c\u043e\u0434\u0430\u043d\u043e\u0432\u0441\u043a\u0438\u0439<\/a>.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1730_%D0%B3%D0%BE%D0%B4\" title=\"1730 \u0433\u043e\u0434\">1730<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D1%8C\" title=\"\u041a\u043e\u0440\u043e\u043b\u044c\">\u041a\u043e\u0440\u043e\u043b\u044c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BE%D1%80%D0%B3_II_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8)\" title=\"\u0413\u0435\u043e\u0440\u0433 II (\u043a\u043e\u0440\u043e\u043b\u044c \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438)\">\u0413\u0435\u043e\u0440\u0433 II<\/a> \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0430\u0435\u0442 \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%BC%D1%8C%D0%B5%D1%80-%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u041f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438\">\u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BE%D0%BB%D0%BF%D0%BE%D0%BB,_%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82\" title=\"\u0423\u043e\u043b\u043f\u043e\u043b, \u0420\u043e\u0431\u0435\u0440\u0442\">\u0420\u043e\u0431\u0435\u0440\u0442\u0430 \u0423\u043e\u043b\u043f\u043e\u043b\u0430<\/a> (Robert Walpole), \u043b\u0438\u0434\u0435\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%B2%D0%B8%D0%B3%D0%BE%D0%B2_(%D0%A1%D0%A8%D0%90)\" title=\"\u041f\u0430\u0440\u0442\u0438\u044f \u0432\u0438\u0433\u043e\u0432 (\u0421\u0428\u0410)\">\u043f\u0430\u0440\u0442\u0438\u0438 \u0432\u0438\u0433\u043e\u0432<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0434\u043e \u044d\u0442\u043e\u0433\u043e 9 \u043b\u0435\u0442 \u0437\u0430\u043d\u0438\u043c\u0430\u043b \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u044c \u043b\u043e\u0440\u0434\u0430-\u043a\u0430\u043d\u0446\u043b\u0435\u0440\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1756_%D0%B3%D0%BE%D0%B4\" title=\"1756 \u0433\u043e\u0434\">1756<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u044f<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0430 \u0432\u043e\u0439\u043d\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>, \u043f\u043e\u043b\u043e\u0436\u0438\u0432 \u043d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BC%D0%B8%D0%BB%D0%B5%D1%82%D0%BD%D1%8F%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0421\u0435\u043c\u0438\u043b\u0435\u0442\u043d\u044f\u044f \u0432\u043e\u0439\u043d\u0430\">\u0421\u0435\u043c\u0438\u043b\u0435\u0442\u043d\u0435\u0439 \u0432\u043e\u0439\u043d\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1768_%D0%B3%D0%BE%D0%B4\" title=\"1768 \u0433\u043e\u0434\">1768<\/a>&#160;\u2014 \u0424\u0440\u0430\u043d\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%81%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_(1768)\" title=\"\u0412\u0435\u0440\u0441\u0430\u043b\u044c\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 (1768)\">\u043a\u0443\u043f\u0438\u043b\u0430 \u041a\u043e\u0440\u0441\u0438\u043a\u0443<\/a> \u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u043e\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D1%83%D1%8F\" title=\"\u0413\u0435\u043d\u0443\u044f\">\u0413\u0435\u043d\u0443\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1770_%D0%B3%D0%BE%D0%B4\" title=\"1770 \u0433\u043e\u0434\">1770<\/a>&#160;\u2014 \u0421\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D0%B0%D0%B4%D1%8C%D0%B1%D0%B0\" title=\"\u0421\u0432\u0430\u0434\u044c\u0431\u0430\">\u0441\u0432\u0430\u0434\u044c\u0431\u0430<\/a> 14-\u043b\u0435\u0442\u043d\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B8%D1%8F-%D0%90%D0%BD%D1%82%D1%83%D0%B0%D0%BD%D0%B5%D1%82%D1%82%D0%B0\" title=\"\u041c\u0430\u0440\u0438\u044f-\u0410\u043d\u0442\u0443\u0430\u043d\u0435\u0442\u0442\u0430\">\u041c\u0430\u0440\u0438\u0438 \u0410\u043d\u0442\u0443\u0430\u043d\u0435\u0442\u0442\u044b<\/a> \u0438 15-\u043b\u0435\u0442\u043d\u0435\u0433\u043e \u0431\u0443\u0434\u0443\u0449\u0435\u0433\u043e \u043a\u043e\u0440\u043e\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%B4%D0%BE%D0%B2%D0%B8%D0%BA_XVI\" title=\"\u041b\u044e\u0434\u043e\u0432\u0438\u043a XVI\">\u041b\u044e\u0434\u043e\u0432\u0438\u043a\u0430 XVI<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1782_%D0%B3%D0%BE%D0%B4\" title=\"1782 \u0433\u043e\u0434\">1782<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82-%D0%9B%D1%83%D0%B8\" title=\"\u041f\u043e\u0440\u0442-\u041b\u0443\u0438\">\u041f\u043e\u0440\u0442-\u041b\u0443\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B2%D1%80%D0%B8%D0%BA%D0%B8%D0%B9\" title=\"\u041c\u0430\u0432\u0440\u0438\u043a\u0438\u0439\">\u041c\u0430\u0432\u0440\u0438\u043a\u0438\u0439<\/a>. \u0421 \u044d\u0442\u043e\u0433\u043e \u0434\u043d\u044f <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%98%D0%BD%D0%B6%D0%B5%D0%BD%D0%B5%D1%80_%D0%91%D0%BE%D1%82%D0%B8%D0%BD%D0%BE&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0418\u043d\u0436\u0435\u043d\u0435\u0440 \u0411\u043e\u0442\u0438\u043d\u043e (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0438\u043d\u0436\u0435\u043d\u0435\u0440 \u0411\u043e\u0442\u0438\u043d\u043e<\/a> \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442 \u0442\u043e\u0447\u043d\u043e \u043f\u0440\u0435\u0434\u0441\u043a\u0430\u0437\u044b\u0432\u0430\u0442\u044c \u043f\u0440\u0438\u0431\u044b\u0442\u0438\u0435 \u043a\u043e\u0440\u0430\u0431\u043b\u0435\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B2%D0%B0%D0%BD%D1%8C\" title=\"\u0413\u0430\u0432\u0430\u043d\u044c\">\u0433\u0430\u0432\u0430\u043d\u044c<\/a> \u0437\u0430 2-3 \u0434\u043d\u044f, \u043a\u043e\u0433\u0434\u0430 \u0440\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u0434\u043e \u043d\u0438\u0445 \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0441\u043e\u0442 \u043c\u0438\u043b\u044c. \u042d\u0442\u043e \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u043b\u043e\u0441\u044c 15 \u043b\u0435\u0442. <\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1800_%D0%B3%D0%BE%D0%B4\" title=\"1800 \u0433\u043e\u0434\">1800<\/a>&#160;\u2014 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BE%D1%80%D0%B3_III_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8)\" class=\"mw-redirect\" title=\"\u0413\u0435\u043e\u0440\u0433 III (\u043a\u043e\u0440\u043e\u043b\u044c \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438)\">\u0413\u0435\u043e\u0440\u0433 III<\/a> \u043f\u0435\u0440\u0435\u0436\u0438\u043b \u043f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u0435 \u0441\u0442\u0440\u0435\u043b\u044f\u0432\u0448\u0435\u0433\u043e \u0432 \u043d\u0435\u0433\u043e <a class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/James_Hadfield\">\u0414\u0436\u0435\u0439\u043c\u0441\u0430 \u0425\u0430\u0434\u0444\u0438\u043b\u0434\u0430<\/a>, \u043f\u043e\u0437\u0434\u043d\u0435\u0435 \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u043d\u043e\u0433\u043e \u043d\u0435\u0432\u043c\u0435\u043d\u044f\u0435\u043c\u044b\u043c.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1811_%D0%B3%D0%BE%D0%B4\" title=\"1811 \u0433\u043e\u0434\">1811<\/a>&#160;\u2014 \u041f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B0%D0%B3%D0%B2%D0%B0%D0%B9\" title=\"\u041f\u0430\u0440\u0430\u0433\u0432\u0430\u0439\">\u041f\u0430\u0440\u0430\u0433\u0432\u0430\u044f<\/a> \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1813_%D0%B3%D0%BE%D0%B4\" title=\"1813 \u0433\u043e\u0434\">1813<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a class=\"external text\" href=\"https:\/\/es.wikipedia.org\/wiki\/Guerra_de_la_Independencia_de_Chile\">\u0427\u0438\u043b\u0438\u0439\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u0437\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a class=\"external text\" href=\"https:\/\/es.wikipedia.org\/wiki\/Batalla_de_San_Carlos_%281813%29\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0421\u0430\u043d-\u041a\u0430\u0440\u043b\u043e\u0441\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1829_%D0%B3%D0%BE%D0%B4\" title=\"1829 \u0433\u043e\u0434\">1829<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0432\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430 \u043f\u0440\u043e\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u044b\u0445 \u0438 \u043a\u0443\u0441\u0442\u0430\u0440\u043d\u044b\u0445 \u0438\u0437\u0434\u0435\u043b\u0438\u0439 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0451\u043d\u043d\u044b\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0418\u043c\u043f\u0435\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1846_%D0%B3%D0%BE%D0%B4\" title=\"1846 \u0433\u043e\u0434\">1846<\/a>&#160;\u2014 \u0412 \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435 \u04