/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a> \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_II\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u043c II<\/a> \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0451\u043d \u0443\u0441\u0442\u0430\u0432 \u041e\u0431\u0449\u0435\u0441\u0442\u0432\u0430 \u043f\u043e\u043f\u0435\u0447\u0435\u043d\u0438\u044f \u043e \u0440\u0430\u043d\u0435\u043d\u044b\u0445 \u0438 \u0431\u043e\u043b\u044c\u043d\u044b\u0445 \u0432\u043e\u0438\u043d\u0430\u0445; \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1879_%D0%B3%D0%BE%D0%B4\" title=\"1879 \u0433\u043e\u0434\">1879 \u0433\u043e\u0434\u0430<\/a>&#160;\u2014 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u043e \u041a\u0440\u0430\u0441\u043d\u043e\u0433\u043e \u041a\u0440\u0435\u0441\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1875_%D0%B3%D0%BE%D0%B4\" title=\"1875 \u0433\u043e\u0434\">1875<\/a>&#160;\u2014 \u0417\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F\" title=\"\u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f\">\u041a\u043e\u043b\u0443\u043c\u0431\u0438\u0438<\/a>, \u0434\u043b\u044f\u0449\u0435\u0435\u0441\u044f \u0432\u0441\u0435\u0433\u043e 45 \u0441\u0435\u043a\u0443\u043d\u0434, \u0443\u043d\u043e\u0441\u0438\u0442 \u0436\u0438\u0437\u043d\u0438 16 \u0442\u044b\u0441\u044f\u0447 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D0%BB%D0%BE%D0%B2%D0%B5%D0%BA_%D1%80%D0%B0%D0%B7%D1%83%D0%BC%D0%BD%D1%8B%D0%B9\" title=\"\u0427\u0435\u043b\u043e\u0432\u0435\u043a \u0440\u0430\u0437\u0443\u043c\u043d\u044b\u0439\">\u0447\u0435\u043b\u043e\u0432\u0435\u043a<\/a>. \u041e\u0434\u043d\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B5%D0%BC%D0%BB%D0%B5%D1%82%D1%80%D1%8F%D1%81%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0417\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435\">\u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435\u043c<\/a> \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u0438\u0442 \u0438\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%83%D0%BB%D0%BA%D0%B0%D0%BD\" title=\"\u0412\u0443\u043b\u043a\u0430\u043d\">\u0432\u0443\u043b\u043a\u0430\u043d\u0430<\/a>, \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u043e\u0433\u043e \u0440\u044f\u0434\u043e\u043c \u0441 \u0433\u043e\u0440\u043e\u0434\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9A%D0%BE%D0%BA%D1%83%D1%82%D0%BE&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041a\u043e\u043a\u0443\u0442\u043e (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041a\u043e\u043a\u0443\u0442\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1883_%D0%B3%D0%BE%D0%B4\" title=\"1883 \u0433\u043e\u0434\">1883<\/a>&#160;\u2014 \u0412 \u0420\u043e\u0441\u0441\u0438\u0438 \u043f\u0440\u0438\u043d\u044f\u0442 \u0437\u0430\u043a\u043e\u043d \u043e \u0440\u0430\u0441\u043a\u043e\u043b\u044c\u043d\u0438\u043a\u0430\u0445-<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D1%80%D0%BE%D0%BE%D0%B1%D1%80%D1%8F%D0%B4%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0421\u0442\u0430\u0440\u043e\u043e\u0431\u0440\u044f\u0434\u0447\u0435\u0441\u0442\u0432\u043e\">\u0441\u0442\u0430\u0440\u043e\u043e\u0431\u0440\u044f\u0434\u0446\u0430\u0445<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1891_%D0%B3%D0%BE%D0%B4\" title=\"1891 \u0433\u043e\u0434\">1891<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BF%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041f\u0430\u043f\u0441\u0442\u0432\u043e\">\u041f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B2_XIII_(%D0%BF%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u041b\u0435\u0432 XIII (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u041b\u0435\u0432 XIII<\/a> \u0438\u0437\u0434\u0430\u043b \u044d\u043d\u0446\u0438\u043a\u043b\u0438\u043a\u0443, \u043e\u0431\u044f\u0437\u044b\u0432\u0430\u044e\u0449\u0443\u044e \u0440\u0430\u0431\u043e\u0442\u043e\u0434\u0430\u0442\u0435\u043b\u0435\u0439 \u0437\u0430\u0431\u043e\u0442\u0438\u0442\u044c\u0441\u044f \u043e \u0431\u043b\u0430\u0433\u043e\u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0438 \u0440\u0430\u0431\u043e\u0447\u0438\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1897_%D0%B3%D0%BE%D0%B4\" title=\"1897 \u0433\u043e\u0434\">1897<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u0432\u044b\u0448\u0435\u043b \u0432 \u0441\u0432\u0435\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 \u0436\u0443\u0440\u043d\u0430\u043b\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE%D0%B5_%D1%8D%D0%BA%D0%BE%D0%BD%D0%BE%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B5_%D0%BE%D0%B1%D0%BE%D0%B7%D1%80%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0420\u0443\u0441\u0441\u043a\u043e\u0435 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043e\u0431\u043e\u0437\u0440\u0435\u043d\u0438\u0435\">\u0420\u0443\u0441\u0441\u043a\u043e\u0435 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043e\u0431\u043e\u0437\u0440\u0435\u043d\u0438\u0435<\/a>\u00bb \u043f\u043e\u0434 \u0440\u0435\u0434\u0430\u043a\u0446\u0438\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%91%D0%B4%D0%BE%D1%80%D0%BE%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87_(%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B8%D0%BA)\" title=\"\u0424\u0451\u0434\u043e\u0440\u043e\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447 (\u043f\u043e\u043b\u0438\u0442\u0438\u043a)\">\u041c.&#160;\u041c.&#160;\u0424\u0451\u0434\u043e\u0440\u043e\u0432\u0430<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1902_%D0%B3%D0%BE%D0%B4\" title=\"1902 \u0433\u043e\u0434\">1902<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82%D1%83%D0%B3%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u044f\">\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u044f<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442 \u0441\u0435\u0431\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D1%81%D0%BE%D1%81%D1%82%D0%BE%D1%8F%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%BE%D1%81%D1%82%D1%8C\" title=\"\u041d\u0435\u0441\u043e\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c\">\u0431\u0430\u043d\u043a\u0440\u043e\u0442\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905<\/a>&#160;\u2014 \u041e\u0441\u043d\u043e\u0432\u0430\u043d \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%81-%D0%92%D0%B5%D0%B3%D0%B0%D1%81\" title=\"\u041b\u0430\u0441-\u0412\u0435\u0433\u0430\u0441\">\u041b\u0430\u0441-\u0412\u0435\u0433\u0430\u0441<\/a> \u0432 \u0448\u0442\u0430\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B2%D0%B0%D0%B4%D0%B0\" title=\"\u041d\u0435\u0432\u0430\u0434\u0430\">\u041d\u0435\u0432\u0430\u0434\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1910_%D0%B3%D0%BE%D0%B4\" title=\"1910 \u0433\u043e\u0434\">1910<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439<\/a> \u0433\u0440\u0443\u0437\u043e\u0432\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BE%D1%85%D0%BE%D0%B4\" title=\"\u041f\u0430\u0440\u043e\u0445\u043e\u0434\">\u043f\u0430\u0440\u043e\u0445\u043e\u0434<\/a> \u00abSkerryworth\u00bb \u0431\u043b\u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D1%81%D1%82%D0%B8%D0%BD%D0%B3%D1%81\" title=\"\u0413\u0430\u0441\u0442\u0438\u043d\u0433\u0441\">\u0413\u0430\u0441\u0442\u0438\u043d\u0433\u0441\u0430<\/a> \u0441\u0442\u0430\u043b\u043a\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0438\u043c<\/a> \u043f\u044f\u0442\u0438\u043c\u0430\u0447\u0442\u043e\u0432\u044b\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%80%D0%BA\" title=\"\u0411\u0430\u0440\u043a\">\u0431\u0430\u0440\u043a\u043e\u043c<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=J._%D0%A1._Vinnen&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"J. \u0421. Vinnen (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441