0 \u0438 \u0441\u043f\u043e\u0440\u0442\u00bb.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928_%D0%B3%D0%BE%D0%B4\" title=\"1928 \u0433\u043e\u0434\">1928<\/a>&#160;\u2014 \u0432 \u043c\u0443\u043b\u044c\u0442\u0444\u0438\u043b\u044c\u043c\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Plane_Crazy\" class=\"mw-redirect\" title=\"Plane Crazy\">Plane Crazy<\/a>\u00bb \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u043e\u044f\u0432\u0438\u043b\u0441\u044f \u043c\u0443\u043b\u044c\u0442\u0438\u043f\u043b\u0438\u043a\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u0433\u0435\u0440\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BA%D0%BA%D0%B8_%D0%9C%D0%B0%D1%83%D1%81\" title=\"\u041c\u0438\u043a\u043a\u0438 \u041c\u0430\u0443\u0441\">\u041c\u0438\u043a\u043a\u0438 \u041c\u0430\u0443\u0441<\/a>, \u043d\u043e \u0432\u043d\u0430\u0447\u0430\u043b\u0435 \u043e\u043d \u0435\u0449\u0451 \u043d\u0435 \u0438\u043c\u0435\u043b \u0433\u043e\u043b\u043e\u0441\u0430 \u0438 \u043c\u0430\u043b\u043e \u043f\u043e\u0445\u043e\u0434\u0438\u043b \u043d\u0430 \u0441\u0435\u0431\u044f \u0431\u0443\u0434\u0443\u0449\u0435\u0433\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 \u0413\u0430\u0437\u043e\u0434\u0438\u043d\u0430\u043c\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043b\u0430\u0431\u043e\u0440\u0430\u0442\u043e\u0440\u0438\u044f&#160;\u2014 \u041e\u043f\u044b\u0442\u043d\u043e-\u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0442\u043e\u0440\u0441\u043a\u043e\u0435 \u0431\u044e\u0440\u043e (\u041d\u041f\u041e \u00ab\u042d\u043d\u0435\u0440\u0433\u043e\u043c\u0430\u0448\u00bb \u0438\u043c. \u0412.&#160;\u041f.&#160;\u0413\u043b\u0443\u0448\u043a\u043e).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930_%D0%B3%D0%BE%D0%B4\" title=\"1930 \u0433\u043e\u0434\">1930<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%B9%D0%B1%D1%8B%D1%88%D0%B5%D0%B2,_%D0%92%D0%B0%D0%BB%D0%B5%D1%80%D0%B8%D0%B0%D0%BD_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0443\u0439\u0431\u044b\u0448\u0435\u0432, \u0412\u0430\u043b\u0435\u0440\u0438\u0430\u043d \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0412\u0430\u043b\u0435\u0440\u0438\u0430\u043d \u041a\u0443\u0439\u0431\u044b\u0448\u0435\u0432<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%B3%D0%BE%D0%B4%D0%B0,_%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u042f\u0433\u043e\u0434\u0430, \u0413\u0435\u043d\u0440\u0438\u0445 \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\">\u0413\u0435\u043d\u0440\u0438\u0445 \u042f\u0433\u043e\u0434\u0430<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 \u00ab\u0426\u0438\u0440\u043a\u0443\u043b\u044f\u0440 \u0412\u044b\u0441\u0448\u0435\u0433\u043e \u0421\u043e\u0432\u0435\u0442\u0430 \u041d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0425\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0430 \u0438 \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u043e\u0433\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f\u00bb \u043e\u0431 \u00ab\u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0438 \u043d\u0430 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u0430\u0445 \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u043e\u0432, \u043e\u0441\u0443\u0436\u0434\u0451\u043d\u043d\u044b\u0445 \u0437\u0430 \u0432\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u00bb. \u0426\u0438\u0440\u043a\u0443\u043b\u044f\u0440 \u043f\u043e\u043b\u043e\u0436\u0438\u043b \u043d\u0430\u0447\u0430\u043b\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u043c\u044b\u043c \u00ab\u0448\u0430\u0440\u0430\u0448\u043a\u0430\u043c\u00bb, \u0447\u0442\u043e \u0444\u043e\u0440\u043c\u0443\u043b\u0438\u0440\u043e\u0432\u0430\u043b\u043e\u0441\u044c \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0432\u0438\u0442\u0438\u0435\u0432\u0430\u0442\u043e: \u00ab\u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435 \u0432\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u0435\u0439 \u0441\u043b\u0435\u0434\u0443\u0435\u0442 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u0442\u044c \u0442\u0430\u043a\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c, \u0447\u0442\u043e\u0431\u044b \u0440\u0430\u0431\u043e\u0442\u0430 \u0438\u0445 \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u043b\u0430 \u0432 \u043f\u043e\u043c\u0435\u0449\u0435\u043d\u0438\u044f\u0445 \u043e\u0440\u0433\u0430\u043d\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%93%D0%9F%D0%A3_%D0%BF%D1%80%D0%B8_%D0%A1%D0%9D%D0%9A_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u041e\u0413\u041f\u0423 \u043f\u0440\u0438 \u0421\u041d\u041a \u0421\u0421\u0421\u0420\">\u041e\u0413\u041f\u0423<\/a>.\u00bb<\/li><li>\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D1%91%D1%80%D1%87,_%D0%AD%D0%BB%D0%BB%D0%B5%D0%BD\" title=\"\u0427\u0451\u0440\u0447, \u042d\u043b\u043b\u0435\u043d\">\u042d\u043b\u043b\u0435\u043d \u0427\u0451\u0440\u0447<\/a> \u0441\u0442\u0430\u043b\u0430 \u043f\u0435\u0440\u0432\u043e\u0439 \u0432 \u043c\u0438\u0440\u0435 \u0441\u0442\u044e\u0430\u0440\u0434\u0435\u0441\u0441\u043e\u0439.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932<\/a><ul><li>\u0414\u0435\u043a\u0440\u0435\u0442\u043e\u043c \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430  \u0437\u0430 \u043f\u043e\u0434\u043f\u0438\u0441\u044c\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD,_%D0%98%D0%BE%D1%81%D0%B8%D1%84_%D0%92%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0442\u0430\u043b\u0438\u043d, \u0418\u043e\u0441\u0438\u0444 \u0412\u0438\u0441\u0441\u0430\u0440\u0438\u043e\u043d\u043e\u0432\u0438\u0447\">\u0421\u0442\u0430\u043b\u0438\u043d\u0430<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%B7%D0%B1%D0%BE%D0%B6%D0%BD%D0%B0%D1%8F_%D0%BF%D1%8F%D1%82%D0%B8%D0%BB%D0%B5%D1%82%D0%BA%D0%B0\" title=\"\u0411\u0435\u0437\u0431\u043e\u0436\u043d\u0430\u044f \u043f\u044f\u0442\u0438\u043b\u0435\u0442\u043a\u0430\">\u0431\u0435\u0437\u0431\u043e\u0436\u043d\u0430\u044f \u043f\u044f\u0442\u0438\u043b\u0435\u0442\u043a\u0430<\/a>\u00bb, \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u0432\u0448\u0430\u044f \u0446\u0435\u043b\u044c: \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1_%D0%BC%D0%B0%D1%8F\" title=\"1 \u043c\u0430\u044f\">1 \u043c\u0430\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937\" class=\"mw-redirect\" title=\"1937\">1937<\/a> \u00ab\u0438\u043c\u044f \u0431\u043e\u0433\u0430 \u0434\u043e\u043b\u0436\u043d\u043e \u0431\u044b\u0442\u044c \u0437\u0430\u0431\u044b\u0442\u043e \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u0441\u0442\u0440\u0430\u043d\u044b\u00bb.  <\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D1%86%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_15_%D0%BC%D0%B0%D1%8F_1932_%D0%B3%D0%BE%D0%B4%D0%B0\" title=\"\u0418\u043d\u0446\u0438\u0434\u0435\u043d\u0442 15 \u043c\u0430\u044f 1932 \u0433\u043e\u0434\u0430\">\u041f\u043e\u043f\u044b\u0442\u043a\u0430 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0435\u0432\u043e\u0440\u043e\u0442\u0430 \u0432 \u042f\u043f\u043e\u043d\u0438\u0438<\/a>, \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u043d\u044f\u0442\u0430\u044f \u0433\u0440\u0443\u043f\u043f\u043e\u0439 \u044d\u043a\u0441\u0442\u0440\u0435\u043c\u0438\u0441\u0442\u043e\u0432&#160;\u2014 \u043c\u043e\u043b\u043e\u0434\u044b\u043c\u0438 \u043e\u0444\u0438\u0446\u0435\u0440\u0430\u043c\u0438 \u0430\u0440\u043c\u0438\u0438 \u0438 \u0444\u043b\u043e\u0442\u0430, \u0433\u0440\u0443\u043f\u043f\u043e\u0439 \u0431\u043e\u0435\u0432\u0438\u043a\u043e\u0432 \u0438\u0437 \u0410\u0439\u043a\u0451\u0434\u0437\u044e\u043a\u0443 (\u0428\u043a\u043e\u043b\u044b \u043b\u044e\u0431\u0432\u0438 \u043a \u0440\u043e\u0434\u043d\u043e\u0439 \u0437\u0435\u043c\u043b\u0435), \u0414\u0437\u0438\u043c\u043c\u0443\u043a\u0430\u0439 (\u041e\u0431\u0449\u0435\u0441\u0442\u0432\u043e \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 \u0414\u0437\u0438\u043c\u043c\u0443) \u0438 \u041a\u044d\u0446\u0443\u043c\u044d\u0439\u0434\u0430\u043d (\u041b\u0438\u0433\u0430 \u043a\u0440\u043e\u0432\u0430\u0432\u043e\u0433\u043e \u0431\u0440\u0430\u0442\u0441\u0442\u0432\u0430), \u043d\u0435\u0434\u043e\u0432\u043e\u043b\u044c\u043d\u044b\u043c\u0438 \u0440\u0430\u0442\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u0435\u0439 \u041b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u043e\u0433\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430 1930&#160;\u0433. \u043e\u0431 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0438\u0438 \u043c\u043e\u0440\u0441\u043a\u0438\u0445 \u0432\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u0439.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934_%D0%B3%D0%BE%D0%B4\" title=\"1934 \u0433\u043e\u0434\">1934<\/a><ul><li>\u0412\u044b\u0448\u043b\u043e \u041f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%9A%D0%BE%D0%BC%D0%B8%D1%82%D0%B5%D1%82_%D0%9A%D0%9F%D0%A1%D0%A1\" class=\"mw-redirect\" title=\"\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u041a\u043e\u043c\u0438\u0442\u0435\u0442 \u041a\u041f\u0421\u0421\">\u0426\u041a \u0412\u041a\u041f(\u0431)<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%BE%D0%B2_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u0421\u043e\u0432\u0435\u0442 \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u043e\u0432 \u0421\u0421\u0421\u0420\">\u0421\u041d\u041a \u0421\u0421\u0421\u0420<\/a> \u00ab\u041e \u043f\u0440\u0435\u043f\u043e\u0434\u0430\u0432\u0430\u043d\u0438\u0438 \u043e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0432 \u0448\u043a\u043e\u043b\u0430\u0445 \u0421\u0421\u0421\u0420\u00bb (\u0432\u043d\u043e\u0432\u044c \u043e\u0442\u043a\u0440\u044b\u043b\u0430\u0441\u044c \u0440\u0443\u0441\u0441\u043a\u0430\u044f \u0438\u0441\u0442\u043e\u0440\u0438\u044f).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D0%B2%D0%BE%D1%80%D0%BE%D1%82_%D0%B2_%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D0%B8_15_%D0%BC%D0%B0%D1%8F_1934_%D0%B3%D0%BE%D0%B4%D0%B0\" class=\"mw-redirect\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u043f\u0435\u0440\u0435\u0432\u043e\u0440\u043e\u0442 \u0432 \u041b\u0430\u0442\u0432\u0438\u0438 15 \u043c\u0430\u044f 1934 \u0433\u043e\u0434\u0430\">\u041f\u0435\u0440\u0435\u0432\u043e\u0440\u043e\u0442 \u0432 \u041b\u0430\u0442\u0432\u0438\u0438<\/a>, \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u043d\u044b\u0439 \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BB%D0%BC%D0%B0%D0%BD%D0%B8%D1%81,_%D0%9A%D0%B0%D1%80%D0%BB%D0%B8%D1%81_%D0%98%D0%BD%D0%B4%D1%80%D0%B8%D0%BA%D0%BE%D0%B2%D0%B8%D1%87\" class=\"mw-redirect\" title=\"\u0423\u043b\u043c\u0430\u043d\u0438\u0441, \u041a\u0430\u0440\u043b\u0438\u0441 \u0418\u043d\u0434\u0440\u0438\u043a\u043e\u0432\u0438\u0447\">\u041a\u0430\u0440\u043b\u0438\u0441\u043e\u043c \u0423\u043b\u043c\u0430\u043d\u0438\u0441\u043e\u043c<\/a> \u0438 \u0432\u043e\u0435\u043d\u043d\u044b\u043c \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D0%BE%D0%B4%D0%B8%D1%81,_%D0%AF%D0%BD%D0%B8%D1%81\" title=\"\u0411\u0430\u043b\u043e\u0434\u0438\u0441, \u042f\u043d\u0438\u0441\">\u042f\u043d\u0438\u0441\u043e\u043c \u0411\u0430\u043b\u043e\u0434\u0438\u0441\u043e\u043c<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935_%D0%B3%D0%BE%D0%B4\" title=\"1935 \u0433\u043e\u0434\">1935<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0432\u0430\u044f \u043b\u0438\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\">\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\u0430<\/a>&#160;\u2014 \u043e\u0442 \u0441\u0442\u0430\u043d\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%BA%D0%BE%D0%BB%D1%8C%D0%BD%D0%B8%D0%BA%D0%B8_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)\" title=\"\u0421\u043e\u043a\u043e\u043b\u044c\u043d\u0438\u043a\u0438 (\u0441\u0442\u0430\u043d\u0446\u0438\u044