ia.org\/wiki\/%D0%91%D0%B0%D0%B1%D0%B5%D0%BB%D1%8C,_%D0%98%D1%81%D0%B0%D0%B0%D0%BA_%D0%AD%D0%BC%D0%BC%D0%B0%D0%BD%D1%83%D0%B8%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0430\u0431\u0435\u043b\u044c, \u0418\u0441\u0430\u0430\u043a \u042d\u043c\u043c\u0430\u043d\u0443\u0438\u043b\u043e\u0432\u0438\u0447\">\u0418\u0441\u0430\u0430\u043a \u0411\u0430\u0431\u0435\u043b\u044c<\/a>.<\/li><li>\u0412 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u043c \u0421\u043e\u044e\u0437\u0435 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u0448\u0435\u0441\u0442\u0438\u043c\u043e\u0442\u043e\u0440\u043d\u043e\u0433\u043e \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%9D%D0%A2-20#.D0.90.D0.9D.D0.A2-20_.D0.B1.D0.B8.D1.81_.28.D0.9F.D0.A1-124.29\" title=\"\u0410\u041d\u0422-20\">\u0410\u041d\u0422-20 \u0431\u0438\u0441<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0432 \u043f\u0440\u043e\u0434\u0430\u0436\u0435 \u043f\u043e\u044f\u0432\u0438\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B9%D0%BB%D0%BE%D0%BD\" title=\"\u041d\u0435\u0439\u043b\u043e\u043d\">\u043d\u0435\u0439\u043b\u043e\u043d\u043e\u0432\u044b\u0435<\/a> \u0447\u0443\u043b\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a><ul><li>\u041f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0440\u0435\u0430\u043a\u0442\u