2\u043a\u0440\u044b\u043b\u0430\u0441\u044c \u0432\u0441\u0442\u0440\u0435\u0447\u0430 \u0433\u043b\u0430\u0432\u044b \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432 \u0432\u043e\u0441\u044c\u043c\u0438 \u0432\u0435\u0434\u0443\u0449\u0438\u0445 \u0434\u0435\u0440\u0436\u0430\u0432 \u043c\u0438\u0440\u0430, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043d\u0430 \u043f\u0440\u0430\u0432\u0430\u0445 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0447\u043b\u0435\u043d\u0430 \u043f\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u043e\u0432\u0430\u043b\u0430 \u0420\u043e\u0441\u0441\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1999_%D0%B3%D0%BE%D0%B4\" title=\"1999 \u0433\u043e\u0434\">1999<\/a>&#160;\u2014 \u0412 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B4%D1%83%D0%BC%D0%B0\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0434\u0443\u043c\u0430\">\u0413\u043e\u0441\u0434\u0443\u043c\u0435<\/a> \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u0435 \u043f\u043e \u0432\u043e\u043f\u0440\u043e\u0441\u0443 \u043e\u0431 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BC%D0%BF%D0%B8%D1%87%D0%BC%D0%B5%D0%BD%D1%82\" title=\"\u0418\u043c\u043f\u0438\u0447\u043c\u0435\u043d\u0442\">\u0438\u043c\u043f\u0438\u0447\u043c\u0435\u043d\u0442\u0435<\/a> \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D1%8C%D1%86%D0%B8%D0%BD,_%D0%91%D0%BE%D1%80%D0%B8%D1%81_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0415\u043b\u044c\u0446\u0438\u043d, \u0411\u043e\u0440\u0438\u0441 \u041d\u0438\u