5\u0434\u043e\u0432\u0430\u043b 66 \u043c\u0438\u043b\u044c (106 \u043a\u043c) \u0441\u043e \u0441\u0440\u0435\u0434\u043d\u0435\u0439 \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c\u044e 47 \u043c\u0438\u043b\u044c\/\u0447 (76 \u043a\u043c\/\u0447).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2009_%D0%B3%D0%BE%D0%B4\" title=\"2009 \u0433\u043e\u0434\">2009<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%A2%D0%B0%D0%B4%D0%B6%D0%B8%D0%BA%D0%B8%D1%81%D1%82%D0%B0%D0%BD%D0%B0\" class=\"mw-redirect\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0422\u0430\u0434\u0436\u0438\u043a\u0438\u0441\u0442\u0430\u043d\u0430\">\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0422\u0430\u0434\u0436\u0438\u043a\u0438\u0441\u0442\u0430\u043d\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BC%D0%BE%D0%BC%D0%B0%D0%BB%D0%B8_%D0%A0%D0%B0%D1%85%D0%BC%D0%BE%D0%BD\" class=\"mw-redirect\" title=\"\u042d\u043c\u043e\u043c\u0430\u043b\u0438 \u0420\u0430\u0445\u043c\u043e\u043d\">\u042d\u043c\u043e\u043c\u0430\u043b\u0438 \u0420\u0430\u0445\u043c\u043e\u043d<\/a> \u0437\u0430\u043f\u0440\u0435\u0442\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B8%D0%BD%D0%BE%D0%B2%D0%BD%D0%B8%D0%BA\" title=\"\u0427\u0438\u043d\u043e\u0432\u043d\u0438\u043a\">\u0447\u0438\u043d\u043e\u0432\u043d\u0438\u043a\u0430\u043c<\/a> \u043f\u043e\u044f\u0432\u043b\u044f\u0442\u044c\u0441\u044f \u043d\u0430 \u043e\u0434\u043d\u0438\u0445 \u0441 \u043d\u0438\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82%D1%80%D0%B5%D1%82\" title=\"\u041f\u043e\u0440\u0442\u0440\u0435\u0442\">\u043f\u043e\u0440\u0442\u0440\u0435\u0442\u0430\u0445<\/a> .<\/li><\/ul><h2>"}